import React from 'react';
import Search from './components/Search';
import SerieList from './components/SerieList';
import data from 'data.json'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1> Movie database </h1>
        <Search/>
      </header>
      <main>

        <SerieList serie={data} />

      </main>
    </div>
  );
}

export default App;
